import React from 'react';
import './App.css';
import { useAppDispatch } from './redux/store';
import {AuthService} from "./services/authService";

function App() {
  const dispatch = useAppDispatch();

  const signIn = async () => {
    dispatch(AuthService.signIn({userId: 'geonil', password: '123123'}));
  }

  return (
    <div className="App">

    </div>
  );
}

export default App;
